import React, { Component } from 'react';
import axios from 'axios';

export default class Dashboard extends Component {
    constructor(props) {
        super(props);

        this.state = {dashboard: ['abc']};
    }

    componentDidMount() {
        axios.get('http://localhost:5000/dashboard/')
          .then(res => {
            console.log(res)
          })
          .catch((error) => {
            console.log(error);
          })

        console.log(this.state.dashboard)
    }

    render() {
        return (
            <div>
                <p>Test</p>
            </div>
        )
    }
}
